import { useState,useEffect} from "react";

//import './login.css'
//import { useDispatch } from "react-redux";
//import { signInUser } from "../redux/authSlice";
const Login = () => {
	const navigate = useNavigate()
	const [Email,setEmail]=useState([]);
	const [Password,setPassword]=useState([]);
	//const dispatch= useDispatch()
	//ADMIN
	//USER

useEffect(()=>{
	fetch('https://symmi-be.symcloud.net/owner/login')
	.then(Response=>Response.json())
	.then(res=>console.log(res.slice(0,10)))
	.catch(err=>console.log(err));

},[])
	const login = () => {
		localStorage.setItem("user", JSON.stringify({role: "ADMIN"}))
		navigate("/dashboard")
		//console.table(Email,Password)
    //dispatch(signInUser({Email,Password}))
	}

	return (

		<div className="full-page">

                    <div className="form-box"  >
                        <div className="form" >
                        <div  className="login-box">
                        <img src= "/pics/logo.png" alt="2.png" className="formlogo"></img>

                </div>
                            <div  className="login-box">

                </div>
                       <h1 className="main-heading">SIGN-IN </h1>
                        <h2 className="head">Welcome to Mobile Repair System</h2>
                                <p>Email/username</p>                               
				                <input  type="text" placeholder="username" value={Email} />
                                <p>Password</p>
				                <input type="password" placeholder="Password" value={Password}  /><br></br>
				                <button type="submit" onClick={Login}>Sign In</button>
                                <p className="message">Dont have an account? contact portal administor</p></div>
				            </div>
                            </div>
	)
}

export default Login
